import React, { useState } from 'react';
import '../Style.K/Booking.css';
import Navbar from '../components/Navbar';
import axios from 'axios';

const BookingPage = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    phone: '',
    make: '',
    name: '',
    year: '',
    bodyStyle: '',
    odometer: '',
    transmission: '',
    engine: '',
    fuelType: '',
    exterior: '',
    passengers: '',
    price: '',
    date: '',
    comments: '',
  });
  const [confirmationMessage, setConfirmationMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Construct the payload for the backend
    const appointmentPayload = {
      userId: 1, // Replace with dynamic userId if available
      date: formData.date,
      time: '10:00:00', // Static time; you can make it dynamic if needed
      service: formData.comments || 'General Service',
      carDetails: {
        make: formData.make,
        name: formData.name,
        year: formData.year,
        bodyStyle: formData.bodyStyle,
        odometer: formData.odometer,
        transmission: formData.transmission,
        engine: formData.engine,
        fuelType: formData.fuelType,
        exterior: formData.exterior,
        passengers: formData.passengers,
        price: formData.price,
      },
    };

    // Post data to the backend
    axios
      .post('http://localhost:8081/api/appointments', appointmentPayload)
      .then((response) => {
        setConfirmationMessage('Your appointment is confirmed! Thank you.');
        setFormData({
          firstName: '',
          lastName: '',
          email: '',
          phone: '',
          make: '',
          name: '',
          year: '',
          bodyStyle: '',
          odometer: '',
          transmission: '',
          engine: '',
          fuelType: '',
          exterior: '',
          passengers: '',
          price: '',
          date: '',
          comments: '',
        });
      })
      .catch((error) => {
        console.error('Error booking appointment:', error);
        setConfirmationMessage('Failed to book appointment. Please try again.');
      });
  };

  return (
    <div>
      <Navbar />
      <div className="booking-page">
        <form className="booking-form" onSubmit={handleSubmit}>
          <h2>Personal Information</h2>
          <div className="form-group">
            <input
              type="text"
              name="firstName"
              value={formData.firstName}
              onChange={handleChange}
              placeholder="First Name (required)"
              required
            />
            <input
              type="text"
              name="lastName"
              value={formData.lastName}
              onChange={handleChange}
              placeholder="Last Name (required)"
              required
            />
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="Email (required)"
              required
            />
            <input
              type="tel"
              name="phone"
              value={formData.phone}
              onChange={handleChange}
              placeholder="Phone (required)"
              required
            />
          </div>

          <h2>Car Details</h2>
          <div className="form-group">
            <input
              type="text"
              name="make"
              value={formData.make}
              onChange={handleChange}
              placeholder="Make (e.g., Ford)"
              required
            />
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              placeholder="Name (e.g., Mustang GT)"
              required
            />
            <input
              type="text"
              name="year"
              value={formData.year}
              onChange={handleChange}
              placeholder="Year (e.g., 2024)"
              required
            />
            <input
              type="text"
              name="bodyStyle"
              value={formData.bodyStyle}
              onChange={handleChange}
              placeholder="Body Style (e.g., Coupe)"
            />
            <input
              type="text"
              name="odometer"
              value={formData.odometer}
              onChange={handleChange}
              placeholder="Odometer (e.g., 300 km)"
            />
            <input
              type="text"
              name="transmission"
              value={formData.transmission}
              onChange={handleChange}
              placeholder="Transmission (e.g., Automatic)"
            />
            <input
              type="text"
              name="engine"
              value={formData.engine}
              onChange={handleChange}
              placeholder="Engine (e.g., V8)"
            />
            <input
              type="text"
              name="fuelType"
              value={formData.fuelType}
              onChange={handleChange}
              placeholder="Fuel Type (e.g., Gasoline)"
            />
            <input
              type="text"
              name="exterior"
              value={formData.exterior}
              onChange={handleChange}
              placeholder="Exterior Color (e.g., Black)"
            />
            <input
              type="number"
              name="passengers"
              value={formData.passengers}
              onChange={handleChange}
              placeholder="Passengers (e.g., 2)"
            />
            <input
              type="text"
              name="price"
              value={formData.price}
              onChange={handleChange}
              placeholder="Price (e.g., $50,000)"
            />
          </div>

          <h2>Appointment Information</h2>
          <div className="form-group">
            <input
              type="date"
              name="date"
              value={formData.date}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <textarea
              name="comments"
              value={formData.comments}
              onChange={handleChange}
              placeholder="Comments or additional requests"
            />
          </div>

          <button type="submit">Submit</button>
        </form>

        {confirmationMessage && (
          <p className="confirmation-message">{confirmationMessage}</p>
        )}

        <div className="booking-contact-info">
          <h3>Contact Information</h3>
          <p>Phone: 855-3X5-50X3</p>
          <p>Address: 506 Main St. N, Reddeer, Alberta L6V 1P9</p>
          <p>Business Hours:</p>
          <p>Monday - Friday: 9:00AM - 7:00PM</p>
          <p>Saturday: 9:00AM - 5:00PM</p>
          <p>Sunday: Closed</p>
          <img
            src="https://plus.unsplash.com/premium_photo-1682089468743-5a31e96f8dd3?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
            alt="Car Consultation"
            className="contact-image"
          />
        </div>
      </div>
    </div>
  );
};

export default BookingPage;
